package me.devkevin.core.tab;

import com.mojang.authlib.properties.Property;

public enum TabIcon {
	
    GREY("", ""), 
    YELLOW("", ""), 
    WHITE("", "");
    
    private String iconTexture;
    private String iconSignature;
    
    private TabIcon(String iconTexture, String iconSignature) {
        this.iconTexture = iconTexture;
        this.iconSignature = iconSignature;
    }
    
    public Property getProperty7() {
        return new Property("textures", this.iconTexture, this.iconSignature);
    }
    
    public Property getProperty() {
        return new Property("textures", this.iconTexture, this.iconSignature);
    }
}
